import React from "react";
import { signOut } from "firebase/auth";
import { auth } from "./Firebase";
import { useNavigate } from "react-router-dom";

import Inicio from "./Inicio";
import Servicios from "./Servicios";
import Contacto from "./Contacto";

const Home = ({ user }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    signOut(auth)
      .then(() => {
        // Sign-out successful.
        navigate("/");
        console.log("Signed out successfully");
      })
      .catch((error) => {
        // An error happened.
        console.error("Error signing out:", error);
      });
  };

  return (
    <nav className="home">
      {/* Contenido de la página principal */}
      <h1 className="mision">Tu tranquilidad es nuestra misión</h1>
      <h1 className="vision">Tu confianza nos impulsa. Brindamos soluciones de ciberseguridad de clase mundial para que puedas enfocarte en hacer crecer tu negocio sin temor a interrupciones.</h1>
      <button className="buttonn" onClick={handleLogout}>Analisis Gratuito</button>
      <div>
        {user ? (
          <button onClick={handleLogout}>Logout</button>
        ) : (
          <p></p>
        )}
      </div>

      {/* Aquí se definen las rutas */}
      <Route path="/inicio" element={<Inicio />} />
      <Route path="/servicios" element={<Servicios />} />
      <Route path="/contacto" element={<Contacto />} />
    </nav>
  );
};

export default Home;
